function List(props) {
    const category = props.category;
    const itemlist = props.item;
    const listitems = itemlist.map(item => (
      <li key={item.id}>
        {item.name}: <b>{item.calories}</b>
      </li>
    ));
  
    return (
      <>
        <h3>{category}</h3>
        <ol className="list-items">{listitems}</ol>
      </>
    );
  }
  
  export default List;
